@Wannabe Vegan 
Minimalistic? 
Have you ever been to the Khumbu region? You have no clue waht you are talking about. These people get in highseason so much cash, they travel, buy the newest smartphones and showing photos of NYC visits in their lodges. Since trekking tourism is huge, they become super materialistic. It's a problem, all they see in western people is money. I was there trekking as a student on budget and I got altitude sickness. In Gorab Shep just 2hours before the everest base camp they didn't give a fuck and wanted me to buy stuff. I had to go down to the pyramide science station where they finally helped me. Not saying every sherpa/nepali is like that but especially in the Khumbu region it's disgusting.

@Rexx Bailey Everest is easier 'technically' speaking. I agree, mountains like K2 and Nanga Parbat are 10 times harder to climb than everest, but that doesn't change the fact that each mountain has the same problem; weather.


They are all above 8,000m and the weather is unpredictable as fuck. It doesn't matter how 'easy' it is to climb- as I remember hearing from an Everest guide: "Anyone can climb everest on the right day, but not every day is the right day"-
The extreme winds and the freezing temperatures are deadly, and if you're caught on top of Everest in a blizzard, you are screwed- as these people were.
